import React from 'react';
import Player from '../components/Player'

const listData = [];
for (let i = 0; i < 5; i++) {
  listData.push({
    index: i,
    name: "This is user: " + i,
    score: i * 10,
    game: 'poker'
  });
}


class PlayerScore extends React.Component {
  render() {
    return (
      <Player />
    );
  }
}

export default PlayerScore;
